import React from 'react';
import './App.css';
import Row from './Row';
import requests from './requests';

function App() {
  return (
    <div className="App">
      <h1>XU</h1>
      <Row title="NETFLIX ORIGINALS" fetchUrl={requests.fetchNetflixOriginals} />
      <Row title="Trending Now" fetchUrl={requests.fetchTrending} />
      <Row title="Top Rated" fetchUrl={requests.fetchTrending} />
      <Row title="Action Films" fetchUrl={requests.fetchTrending} />
      <Row title="Comedy Films" fetchUrl={requests.fetchTrending} />
      <Row title="Horror Films" fetchUrl={requests.fetchTrending} />
      <Row title="Romance Films" fetchUrl={requests.fetchTrending} />
      <Row title="Documentaries Films" fetchUrl={requests.fetchTrending} />
      <Row title="Trending Films" fetchUrl={requests.fetchTrending} />
    </div>
  );
}

export default App;
